class DashboardViewStore {
    @observable user = null;
    constructor(rootStore) {
        this.rootStore = rootStore;
        this.user = sessionStorage.getItem('user');
    }

    logOut = () => {
        this.rootStore.authStore.logOut();
    }
}

export default DashboardViewStore;
